function ProductNameHelper() {
    const imageProduct = (kode) => {
        switch (kode) {
         case "mobile-legends":
             return require("../assets/ml.jpeg");
         case "pubgm":
             return require("../assets/pubgm.jpeg");
         case "valorant":
             return require("../assets/valorant.avif");
         case "lolwr":
             return require("../assets/wild-rift.png");
         case "pubgm":
             return require("../assets/pubgm.jpeg");
         case "valorant":
             return require("../assets/valorant.avif");
         default:
             break;
        } 
     }
}
